@Override public void write(final byte[] b) throws IOException {
	if (b == null) {
		throw new NullPointerException();
	}
	if (buf == null) {
		throw new IOException("Stream closed");
	}
	int len = b.length;
	if (len == 0) {
		return;
	}
	int n = buf.length;
	if (n == 0) {
		throw new IOException("Stream closed");
	}
	int nleft = n - count;
	if (len > nleft) {
		len = nleft;
	}
	System.arraycopy(b, 0, buf, count, len);
	count += len;
	if (count == n) {
		flush();
	}
}

