public static int nextPrime(int desiredCapacity){
	int[] primeCapacities = new int[desiredCapacity];
	int largestPrime = 0;
	for(int i = 0; i < desiredCapacity; i++){
		if(i == 0){
			primeCapacities[i] = 2;
		}
		else{
			primeCapacities[i] = primeCapacities[i-1] + 1;
			while(!isPrime(primeCapacities[i])){
				primeCapacities[i]++;
			}
		}
		if(primeCapacities[i] > largestPrime){
			largestPrime = primeCapacities[i];
		}
	}
	return largestPrime;
}

